def correction_factor(cross_sec):
    return cross_sec/real_cross_section[0]
print(f"flux correction factor from simulation is {correction_factor(be7_cross_section)} +- {correction_factor(be7_cross_section)*total_frac_uncert}")
# calculate experimental source strength of lithium target - by benchmarking to mcnp value
def source_strength_and_flux(correction):
    source_particles_per_second_10ua = 6.24151e+13
    source_stength = correction*source_particles_per_second_10ua*real_source_strength
    flux = correction*source_particles_per_second_10ua*real_fe_flux
    return source_stength,flux

print(f"Source strength at 10uA is {source_strength_and_flux(correction_factor(be7_cross_section))[0]:.5e} +- {total_frac_uncert*source_strength_and_flux(correction_factor(be7_cross_section))[0]:.5e} n/s")
print(f"Flux at fe foil at 10uA is {source_strength_and_flux(correction_factor(be7_cross_section))[1]:.5e} +- {total_frac_uncert*source_strength_and_flux(correction_factor(be7_cross_section))[1]:.5e} n/cm2/s")


